import React from "react";

interface SquareProps {
    position: string;
    width: string;
    height: string;
    borderRadius: string;
    border: string;
    color: string;
    marginLeft?: string;
  marginBlockEnd?: string;
    // left: string;
    // top: string;
}

const Square: React.FC<SquareProps> = ({
    position = "relative",
    width,
    height,
    borderRadius,
    border,
    color,
    marginLeft,
    marginBlockEnd,
    // left,
    // top,
}) => {
    return (
        <div
            style={{
                width,
                height,
                borderRadius,
                border,
                color,
                marginLeft,
                marginBlockEnd,
                // top,
            }}
        ></div>
    );
};

export default Square;
